import React, { useState } from 'react';
import '../style/SoundPage.css';

export default function MusicInsights() {
  const [audioFeatures, setAudioFeatures] = useState({
    instrumentalness: "",
    energy: "",
    valence: "",
    liveness: "",
    acousticness: "",
  });
  const [songs, setSongs] = useState([]); // To store the fetched songs
  const [error, setError] = useState(""); // For error messages
  const [loading, setLoading] = useState(false); // Loading state

  // Function to fetch songs based on audio features
  const fetchSongs = async () => {
    setError(""); // Reset errors
    setSongs([]); // Clear previous results
    setLoading(true); // Set loading to true

    try {
      // Build query string
      const query = new URLSearchParams(
        Object.entries(audioFeatures).filter(([_, value]) => value !== "")
      ).toString();

      if (!query) {
        setError("Please provide at least one audio feature value.");
        setLoading(false);
        return;
      }

      // Fetch data from the API
      const response = await fetch(`http://localhost:8080/songs/audio-features?${query}`);
      if (!response.ok) {
        throw new Error(`Error fetching data: ${response.status}`);
      }

      const data = await response.json();

      if (data.length === 0) {
        setError("No songs found matching the criteria.");
      } else {
        setSongs(data);
      }
    } catch (err) {
      console.error("Error fetching songs:", err);
      setError("An error occurred while fetching songs.");
    } finally {
      setLoading(false); // Stop loading
    }
  };

  // Handle input changes for audio features
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setAudioFeatures((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div id="sound-page-wrapper">
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

      <h1>Track Explorer</h1>

      <div id="page-wrapper">
        <div id="content-wrapper">
          <section className="table-section">
            <h2>Find Songs by Audio Features</h2>
            <div className="controls">
              <label>
                Instrumentalness:
                <input
                  type="number"
                  name="instrumentalness"
                  min="0"
                  max="1"
                  step="0.01"
                  placeholder="0.5"
                  value={audioFeatures.instrumentalness}
                  onChange={handleInputChange}
                />
              </label>
              <label>
                Energy:
                <input
                  type="number"
                  name="energy"
                  min="0"
                  max="1"
                  step="0.01"
                  placeholder="0.7"
                  value={audioFeatures.energy}
                  onChange={handleInputChange}
                />
              </label>
              <label>
                Valence:
                <input
                  type="number"
                  name="valence"
                  min="0"
                  max="1"
                  step="0.01"
                  placeholder="0.6"
                  value={audioFeatures.valence}
                  onChange={handleInputChange}
                />
              </label>
              <label>
                Liveness:
                <input
                  type="number"
                  name="liveness"
                  min="0"
                  max="1"
                  step="0.01"
                  placeholder="0.2"
                  value={audioFeatures.liveness}
                  onChange={handleInputChange}
                />
              </label>
              <label>
                Acousticness:
                <input
                  type="number"
                  name="acousticness"
                  min="0"
                  max="1"
                  step="0.01"
                  placeholder="0.4"
                  value={audioFeatures.acousticness}
                  onChange={handleInputChange}
                />
              </label>
            </div>
            <button onClick={fetchSongs} disabled={loading}>
              {loading ? "Searching..." : "Search"}
            </button>
            {error && <div className="error-message">{error}</div>}
            {songs.length > 0 && (
              <table className="data-table">
                <thead>
                  <tr>
                    <th>Track Title</th>
                    <th>URL</th>
                    <th>Instrumentalness</th>
                    <th>Energy</th>
                    <th>Valence</th>
                    <th>Liveness</th>
                    <th>Acousticness</th>
                  </tr>
                </thead>
                <tbody>
                  {songs.map((song) => (
                    <tr key={song.id}>
                      <td>{song.title}</td>
                      <td>
                        <a href={`https://${song.url}`} target="_blank" rel="noopener noreferrer">
                          Link
                        </a>
                      </td>
                      <td>{song.instrumentalness.toFixed(3)}</td>
                      <td>{song.energy.toFixed(3)}</td>
                      <td>{song.valence.toFixed(3)}</td>
                      <td>{song.liveness.toFixed(3)}</td>
                      <td>{song.acousticness.toFixed(3)}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </section>
        </div>
      </div>
    </div>
  );
}
